(32, '{\"ar\":\"\\u0648\\u0633\\u0645 \\u0627\\u0644\\u0645\\u0633\\u0643\",\"en\":\"Wasm Almusk\"}', 'p', '{\"ar\":\"<p>\\u0639\\u0637\\u0631 \\u0645\\u0645\\u064a\\u0632 \\u0628\\u0631\\u0627\\u0626\\u062d\\u0629 \\u0645\\u062b\\u0627\\u0644\\u064a\\u0629 \\u062a\\u0644\\u0627\\u0626\\u0645 \\u0643\\u0644 \\u0645\\u0646 \\u0627\\u0644\\u0631\\u062c\\u0627\\u0644 \\u0648\\u0627\\u0644\\u0646\\u0633\\u0627\\u0621.<br>\\u0627\\u0644\\u0639\\u0637\\u0631 \\u063a\\u0646\\u064a \\u0628\\u0645\\u0632\\u064a\\u062c \\u0634\\u0631\\u0642\\u064a \\u0641\\u0627\\u062e\\u0631 \\u064a\\u0636\\u0641\\u064a \\u0639\\u0644\\u064a\\u0643 \\u0645\\u0638\\u0647\\u0631 \\u062c\\u0630\\u0627\\u0628 \\u0648\\u0623\\u0646\\u064a\\u0642.<br>\\u064a\\u0628\\u062f\\u0623 \\u0627\\u0644\\u0639\\u0637\\u0631 \\u0628\\u0646\\u0641\\u062d\\u0627\\u062a \\u0645\\u0646 \\u0627\\u0644\\u0628\\u0631\\u063a\\u0645\\u0648\\u062a \\u0627\\u0644\\u0645\\u0646\\u0639\\u0634 \\u0644\\u062a\\u0634\\u0639\\u0631 \\u0628\\u0627\\u0644\\u062d\\u064a\\u0648\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0627\\u0646\\u062a\\u0639\\u0627\\u0634 \\u0641\\u064a \\u0628\\u062f\\u0627\\u064a\\u0629 \\u064a\\u0648\\u0645\\u0643.<br>\\u0648\\u0641\\u064a \\u0627\\u0644\\u0642\\u0644\\u0628 \\u0645\\u0632\\u064a\\u062c \\u0645\\u063a\\u0631\\u064a \\u0648\\u0645\\u062b\\u064a\\u0631 \\u0645\\u0646 \\u0627\\u0644\\u0633\\u0648\\u0633\\u0646 \\u0648\\u062e\\u0634\\u0628 \\u0627\\u0644\\u0635\\u0646\\u0648\\u0628\\u0631.<br>\\u0648\\u064a\\u0646\\u062a\\u0647\\u064a \\u0627\\u0644\\u0639\\u0637\\u0631 \\u0628\\u0646\\u0641\\u062d\\u0627\\u062a \\u0645\\u0646 \\u0627\\u0644\\u0645\\u0633\\u0643 \\u0627\\u0644\\u0630\\u064a \\u064a\\u062c\\u0639\\u0644 \\u0631\\u0627\\u0626\\u062d\\u0629 \\u0627\\u0644\\u0639\\u0637\\u0631 \\u062a\\u062f\\u0648\\u0645 \\u0644\\u0623\\u0637\\u0648\\u0644 \\u0641\\u062a\\u0631\\u0629 \\u0645\\u0645\\u0643\\u0646\\u0629.<br>&nbsp;<\\/p>\",\"en\":\"<p>A distinctive fragrance possesses a perfect scent to suit both men and women.<br>The fragrance is enriched with a luxurious oriental blend that adds to you an attractive and elegant look.<br>The fragrance starts with notes of refreshing bergamot so you can feel vibrant and fresh at the start of your day.<br>The heart reveals a tempting and exciting blend of iris and pine wood.<br>The fragrance ends with notes of musk, which makes the fragrance last as long as possible.<\\/p>\"}', '{\"ar\":\"\\u0639\\u0637\\u0631 \\u0645\\u0645\\u064a\\u0632 \\u0628\\u0631\\u0627\\u0626\\u062d\\u0629 \\u0645\\u062b\\u0627\\u0644\\u064a\\u0629 \\u062a\\u0644\\u0627\\u0626\\u0645 \\u0643\\u0644 \\u0645\\u0646 \\u0627\\u0644\\u0631\\u062c\\u0627\\u0644 \\u0648\\u0627\\u0644\\u0646\\u0633\\u0627\\u0621.\\n\\u0627\\u0644\\u0639\\u0637\\u0631 \\u063a\\u0646\\u064a \\u0628\\u0645\\u0632\\u064a\\u062c \\u0634\\u0631\\u0642\\u064a \\u0641\\u0627\\u062e\\u0631 \\u064a\\u0636\\u0641\\u064a \\u0639\\u0644\\u064a\\u0643 \\u0645\\u0638\\u0647\\u0631 \\u062c\\u0630\\u0627\\u0628 \\u0648\\u0623\\u0646\\u064a\\u0642.\\n\\u064a\\u0628\\u062f\\u0623 \\u0627\\u0644\\u0639\\u0637\\u0631 \\u0628\\u0646\\u0641\\u062d\\u0627\\u062a \\u0645\\u0646 \\u0627\\u0644\\u0628\\u0631\\u063a\\u0645\\u0648\\u062a \\u0627\\u0644\\u0645\\u0646\\u0639\\u0634 \\u0644\\u062a\\u0634\\u0639\\u0631 \\u0628\\u0627\\u0644\\u062d\\u064a\\u0648\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0627\\u0646\\u062a\\u0639\\u0627\\u0634 \\u0641\\u064a \\u0628\\u062f\\u0627\\u064a\\u0629 \\u064a\\u0648\\u0645\\u0643.\\n\\u0648\\u0641\\u064a \\u0627\\u0644\\u0642\\u0644\\u0628 \\u0645\\u0632\\u064a\\u062c \\u0645\\u063a\\u0631\\u064a \\u0648\\u0645\\u062b\\u064a\\u0631 \\u0645\\u0646 \\u0627\\u0644\\u0633\\u0648\\u0633\\u0646 \\u0648\\u062e\\u0634\\u0628 \\u0627\\u0644\\u0635\\u0646\\u0648\\u0628\\u0631.\\n\\u0648\\u064a\\u0646\\u062a\\u0647\\u064a \\u0627\\u0644\\u0639\\u0637\\u0631 \\u0628\\u0646\\u0641\\u062d\\u0627\\u062a \\u0645\\u0646 \\u0627\\u0644\\u0645\\u0633\\u0643 \\u0627\\u0644\\u063