(56, '{\"ar\":\"\\u0647\\u064a\\u0628\\u0647 (\\u0644\\u0644\\u062c\\u0646\\u0633\\u064a\\u0646)\",\"en\":\"Hayba\"}', 'pw', '{\"ar\":\"<p>\\u062c\\u0631\\u0628 \\u0627\\u0644\\u0628\\u0633\\u0627\\u0637\\u0629 \\u0645\\u0639 \\u0627\\u0644\\u0634\\u0631\\u0642\\u064a\\u0629 \\u0647\\u064a\\u0628\\u0629. \\u0645\\u0643\\u0648\\u0646\\u0627\\u062a\\u0647 \\u0627\\u0644\\u0639\\u0644\\u064a\\u0627 \\u0645\\u0646 \\u0627\\u0644\\u0623\\u0632\\u0647\\u0627\\u0631 \\u0627\\u0644\\u062d\\u0627\\u0631\\u0629 \\u0645\\u0634\\u062a\\u0642\\u0629 \\u0645\\u0646 \\u0632\\u0646\\u0628\\u0642 \\u0627\\u0644\\u0648\\u0627\\u062f\\u064a \\u0627\\u0644\\u0645\\u0639\\u0637\\u0631 \\u0628\\u0644\\u0637\\u0641 \\u0648\\u0627\\u0644\\u0648\\u0631\\u062f \\u0627\\u0644\\u0623\\u0628\\u062f\\u064a \\u0648\\u0627\\u0644\\u0632\\u0639\\u0641\\u0631\\u0627\\u0646 \\u0648\\u062c\\u0648\\u0632\\u0629 \\u0627\\u0644\\u0637\\u064a\\u0628. \\u0642\\u0644\\u0628 \\u0647\\u0630\\u0627 \\u0627\\u0644\\u0639\\u0637\\u0631 \\u0647\\u0648 Woody Ambery \\u060c \\u0627\\u0644\\u0630\\u064a \\u062a\\u0645 \\u0625\\u0646\\u0634\\u0627\\u0624\\u0647 \\u0645\\u0646 \\u0639\\u0637\\u0631\\u064a Cypriol \\u0648 Patchouli \\u0648 Musky Ambery \\u060c \\u0641\\u064a \\u062d\\u064a\\u0646 \\u0623\\u0646 \\u0645\\u0643\\u0648\\u0646\\u0627\\u062a\\u0647 \\u0627\\u0644\\u0623\\u0633\\u0627\\u0633\\u064a\\u0629 \\u0647\\u064a \\u0645\\u0632\\u064a\\u062c \\u062e\\u0634\\u0628\\u064a \\u0645\\u0633\\u0643\\u064a \\u0645\\u0646 \\u062e\\u0634\\u0628 \\u0627\\u0644\\u0635\\u0646\\u062f\\u0644 \\u0648\\u062e\\u0634\\u0628 \\u0627\\u0644\\u063a\\u0627\\u064a\\u0627\\u0643 \\u0648\\u062e\\u0634\\u0628 \\u0627\\u0644\\u0623\\u0631\\u0632 \\u0648\\u0627\\u0644\\u0645\\u0633\\u0643 \\u0644\\u0645\\u0646\\u062d\\u0643 \\u0628\\u064a\\u0627\\u0646\\u064b\\u0627 \\u0645\\u062b\\u064a\\u0631\\u064b\\u0627 \\u0648\\u0639\\u0637\\u0631\\u064a\\u064b\\u0627.<\\/p>\",\"en\":\"<p>Experience the simplicity with the oriental Hayba. Its Floral Spicy top notes derived from sweetly scented Lilly of the Valley, everlasting Rose, exotic Saffron and Nutmeg. The heart of this fragrance is Woody Ambery, created from fragrant Cypriol, Patchouli and Musky Ambery, while its base note is a Woody Musky combination of Sandalwood, Guaiac Wood, Cedarwood &amp; Musk to give you exciting and aromatic statement.<\\/p>\"}', '{\"ar\":\"\\u062c\\u0631\\u0628 \\u0627\\u0644\\u0628\\u0633\\u0627\\u0637\\u0629 \\u0645\\u0639 \\u0627\\u0644\\u0634\\u0631\\u0642\\u064a\\u0629 \\u0647\\u064a\\u0628\\u0629. \\u0645\\u0643\\u0648\\u0646\\u0627\\u062a\\u0647 \\u0627\\u0644\\u0639\\u0644\\u064a\\u0627 \\u0645\\u0646 \\u0627\\u0644\\u0623\\u0632\\u0647\\u0627\\u0631 \\u0627\\u0644\\u062d\\u0627\\u0631\\u0629 \\u0645\\u0634\\u062a\\u0642\\u0629 \\u0645\\u0646 \\u0632\\u0646\\u0628\\u0642 \\u0627\\u0644\\u0648\\u0627\\u062f\\u064a \\u0627\\u0644\\u0645\\u0639\\u0637\\u0631 \\u0628\\u0644\\u0637\\u0641 \\u0648\\u0627\\u0644\\u0648\\u0631\\u062f \\u0627\\u0644\\u0623\\u0628\\u062f\\u064a \\u0648\\u0627\\u0644\\u0632\\u0639\\u0641\\u0631\\u0627\\u0646 \\u0648\\u062c\\u0648\\u0632\\u0629 \\u0627\\u0644\\u0637\\u064a\\u0628. \\u0642\\u0644\\u0628 \\u0647\\u0630\\u0627 \\u0627\\u0644\\u0639\\u0637\\u0631 \\u0647\\u0648 Woody Ambery \\u060c \\u0627\\u0644\\u0630\\u064a \\u062a\\u0645 \\u0625\\u0646\\u0634\\u0627\\u0624\\u0647 \\u0645\\u0646 \\u0639\\u0637\\u0631\\u064a Cypriol \\u0648 Patchouli \\u0648 Musky Ambery \\u060c \\u0641\\u064a \\u062d\\u064a\\u0646 \\u0623\\u0646 \\u0645\\u0643\\u0648\\u0646\\u0627\\u062a\\u0647 \\u0627\\u0644\\u0623\\u0633\\u0627\\u0633\\u064a\\u0629 \\u0647\\u064a \\u0645\\u0632\\u064a\\u062c \\u062e\\u0634\\u0628\\u064a \\u0645\\u0633\\u0643\\u064a \\u0645\\u0646 \\u062e\\u0634\\u0628 \\u0627\\u0644\\u0635\\u0646\\u062f\\u0644 \\u0648\\u062e\\u0634\\u0628 \\u0627\\u0644\\u063a\\u0627\\u064a\\u0627\\u0643 \\u0648\\u062e\\u0634\\u0628 \\u0627\\u0644\\u0623\\u0631\\u0632 \\u0648\\u0627\\u0644\\u0645\\u0633\\u0643 \\u0644\\u0645\\u0646\\u062d\\u0643 \\u0628\\u064a\\u0627\\u0646\\u064b\\u0627 \\u0645\\u062b\\u064a\\u0631\\u064b\\u0627 \\u0648\\u0639\\u0637\\u0631\\u064a\\u064b\\u0627.\",\"en\":\"Experience the simplicity with the oriental Hayba. Its Floral Spicy top notes derived from sweetly scented Lilly of the Valley, everlasting Rose, exotic Saffron and Nutmeg. The heart of this fragrance is Woody Ambery, created from fragrant Cypriol, Patchouli and Musky Ambery, while its base note is a Woody Musky combination of Sandalwood, Guaiac Wood, Cedarwood & Musk to give you exciting and aromatic statement.\"}', 12, 0, 20, NULL, 70, NULL, 1, 1, NULL, 290, '2022-01-30 03:03:46', '2022-01-30 03:03:46'),
