(61, '{\"ar\":\"\\u0642\\u0633\\u0645\\u0627\\u062a - \\u0627\\u0628\\u0647\\u0627\\u0631\",\"en\":\"Bakhoor Qasamat - Ebhar\"}', 'b', '{\"ar\":\"<p>Qasamat \\u0647\\u064a \\u0633\\u0644\\u0633\\u0644\\u0629 \\u0645\\u0646 \\u0623\\u0631\\u0628\\u0639\\u0629 \\u0639\\u0637\\u0648\\u0631 \\u0644\\u0644\\u062c\\u0646\\u0633\\u064a\\u0646 \\u0648\\u0645\\u0633\\u062a\\u0648\\u062d\\u0627\\u0629 \\u0645\\u0646 \\u062a\\u0642\\u0627\\u0644\\u064a\\u062f \\u0627\\u0644\\u0639\\u0637\\u0648\\u0631 \\u0627\\u0644\\u063a\\u0646\\u064a\\u0629 \\u0641\\u064a \\u0627\\u0644\\u0634\\u0631\\u0642 \\u0627\\u0644\\u0623\\u0648\\u0633\\u0637. \\u064a\\u062c\\u062f \\u0627\\u0644\\u0628\\u0630\\u062e \\u0648\\u0627\\u0644\\u063a\\u0645\\u0648\\u0636 \\u0627\\u0644\\u063a\\u0627\\u0645\\u0636 \\u0644\\u062d\\u0627\\u0633\\u0629 \\u0627\\u0644\\u0634\\u0645 \\u0627\\u0644\\u0634\\u0631\\u0642\\u064a\\u0629 \\u062a\\u0639\\u0628\\u064a\\u0631\\u064b\\u0627 \\u0645\\u0639\\u0627\\u0635\\u0631\\u064b\\u0627 \\u0641\\u064a \\u0623\\u0631\\u0628\\u0639 \\u0631\\u062d\\u0644\\u0627\\u062a \\u0639\\u0637\\u0631\\u064a\\u0629 \\u0641\\u0631\\u064a\\u062f\\u0629 \\u0645\\u0646 \\u0646\\u0648\\u0639\\u0647\\u0627 \\u060c \\u0648\\u0627\\u0644\\u062a\\u064a \\u0647\\u064a \\u0625\\u062f\\u0645\\u0627\\u0646\\u064a\\u0629 \\u0648\\u062a\\u0628\\u0631\\u0632\\u0647\\u0627 \\u0633\\u0645\\u0627\\u062a \\u0645\\u0645\\u064a\\u0632\\u0629. \\u062a\\u062d\\u062a\\u0641\\u0644 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u0639\\u0637\\u0648\\u0631 \\u0628\\u062d\\u0628 \\u0628\\u0644\\u064a\\u0646\\u063a \\u0643\\u0644\\u063a\\u0629 \\u0644\\u0644\\u062a\\u0639\\u0628\\u064a\\u0631 \\u0639\\u0646 \\u0627\\u0644\\u0630\\u0627\\u062a \\u0641\\u064a \\u0627\\u0644\\u0639\\u0635\\u0631 \\u0627\\u0644\\u062d\\u062f\\u064a\\u062b \\u0648\\u062a\\u062a\\u0645\\u062a\\u0639 \\u0628\\u0623\\u0646\\u0627\\u0642\\u0629 \\u0633\\u0647\\u0644\\u0629 \\u0648\\u0628\\u0647\\u062c\\u0629 \\u0645\\u0639\\u062f\\u064a\\u0629 \\