u0644\\u0649 \\u0627\\u0644\\u0644\\u0627\\u0628\\u062f\\u0627\\u0646\\u0648\\u0645 \\u0639\\u0645\\u0642\\u064b\\u0627 \\u0642\\u0648\\u064a\\u064b\\u0627 \\u0645\\u0646 \\u0627\\u0644\\u062c\\u0644\\u062f. \\u0623\\u062c\\u0648\\u0627\\u062f \\u0647\\u064a \\u062a\\u062c\\u0631\\u0628\\u0629 \\u0645\\u0639\\u0642\\u062f\\u0629 \\u0648\\u0645\\u062a\\u0637\\u0648\\u0631\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u0637\\u0648\\u0641\\u0627\\u0646 \\u0627\\u0644\\u0645\\u062a\\u0646\\u0648\\u0639 \\u0648\\u0627\\u0644\\u0631\\u0627\\u0626\\u0639 \\u0627\\u0644\\u0630\\u064a \\u064a\\u0634\\u0628\\u0647 \\u0631\\u062d\\u0644\\u0629 \\u0639\\u0628\\u0631 \\u0627\\u0644\\u0639\\u0648\\u0627\\u0637\\u0641 \\u0627\\u0644\\u0645\\u062a\\u0646\\u0648\\u0639\\u0629.<br>&nbsp;<\\/p>\",\"en\":\"<p><br>Contemporary, reinterpretation of a very floriental fragrance.<br>Bukhoor Al Ajwad is a &nbsp;contemperary, reinterpretation of a very floriental fragrance. The opening zesty bergamot, with lusciously tarty spice inflected blueberry conjures happy memories. The scent of a thousand roses aloft sweetened wafting jasmine opens into a &nbsp;rich creamy, lingering oriental base of precious oudh, cashmere musk and sandalwood, lent a powerful ambry-leathery depth by labdanum. &nbsp;Ajwad is complex and sophisticated experience of varying and brilliant deluges akin to a journey through varied emotions.<br>&nbsp;<\\/p>\"}', '{\"ar\":\"\\u0645\\u0641\\u0647\\u0648\\u0645 \\u0639\\u0635\\u0631\\u064a \\u062c\\u062f\\u064a\\u062f \\u0644\\u0644\\u0639\\u0637\\u0648\\u0631 \\u0628\\u0637\\u0627\\u0628\\u0639 \\u0648\\u0631\\u062f\\u064a \\u062d\\u0627\\u0644\\u0645.\\n\\u0628\\u062e\\u0648\\u0631 \\u0627\\u0644\\u0623\\u062c\\u0648\\u0627\\u062f \\u0647\\u0648 \\u0625\\u0639\\u0627\\u062f\\u0629 \\u062a\\u0641\\u0633\\u064a\\u0631 \\u0645\\u0639\\u0627\\u0635\\u0631\\u0629 \\u0644\\u0639\\u0637\\u0631 \\u0632\\u0647\\u0631\\u064a \\u0644\\u0644\\u063a\\u0627\\u064a\\u0629. \\u064a\\u0633\\u062a\\u062d\\u0636\\u0631 \\u0627\\u0644\\u0628\\u0631\\u063a\\u0645\\u0648\\u062a \\u0627\\u0644\\u0627\\u0641\\u062a\\u062a\\u0627\\u062d\\u064a \\u060c \\u0645\\u0639 \\u0627\\u0644\\u062a\\u0648\\u0627\\u0628\\u0644 \\u0627\\u0644\\u0644\\u0630\\u064a\\u0630\\u0629 \\u0648\\u0627\\u0644\\u062a\\u0648\\u062a \\u0627\\u0644\\u0628\\u0631\\u064a \\u060c \\u0627\\u0644\\u0630\\u0643\\u0631\\u064a\\u0627\\u062a \\u0627\\u0644\\u0633\\u0639\\u064a\\u062f\\u0629. \\u062a\\u0646\\u0641\\u062a\\u062d \\u0631\\u0627\\u0626\\u062d\\u0629 \\u0623\\u0644\\u0641 \\u0648\\u0631\\u062f\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u064a\\u0627\\u0633\\u0645\\u064a\\u0646 \\u0627\\u0644\\u0645\\u062d\\u0644\\u0649 \\u0639\\u0627\\u0644\\u064a\\u0627\\u064b \\u0639\\u0644\\u0649 \\u0642\\u0627\\u0639\\u062f\\u0629 \\u0634\\u0631\\u0642\\u064a\\u0629 \\u063a\\u0646\\u064a\\u0629 \\u0643\\u0631\\u064a\\u0645\\u064a\\u0629 \\u0637\\u0648\\u064a\\u0644\\u0629 \\u0627\\u0644\\u0623\\u0645\\u062f \\u0645\\u0646 \\u0627\\u0644\\u0639\\u0648\\u062f \\u0627\\u0644\\u062b\\u0645\\u064a\\u0646 \\u0648\\u0645\\u0633\\u0643 \\u0627\\u0644\\u0643\\u0634\\u0645\\u064a\\u0631 \\u0648\\u062e\\u0634\\u0628 \\u0627\\u0644\\u0635\\u0646\\u062f\\u0644 \\u060c \\u0645\\u0645\\u0627 \\u064a\\u0636\\u0641\\u064a \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0644\\u0627\\u0628\\u062f\\u0627\\u0646\\u0648\\u0645 \\u0639\\u0645\\u0642\\u064b\\u0627 \\u0642\\u0648\\u064a\\u064b\\u0627 \\u0645\\u0646 \\u0627\\u0644\\u062c\\u0644\\u062f. \\u0623\\u062c\\u0648\\u0627\\u062f \\u0647\\u064a \\u062a\\u062c\\u0631\\u0628\\u0629 \\u0645\\u0639\\u0642\\u062f\\u0629 \\u0648\\u0645\\u062a\\u0637\\u0648\\u0631\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u0637\\u0648\\u0641\\u0627\\u0646 \\u0627\\u0644\\u0645\\u062a\\u0646\\u0648\\u0639 \\u0648\\u0627\\u0644\\u0631\\u0627\\u0626\\u0639 \\u0627\\u0644\\u0630\\u064a \\u064a\\u0634\\u0628\\u0647 \\u0631\\u062d\\u0644\\u0629 \\u0639\\u0628\\u0631 \\u0627\\u0644\\u0639\\u0648\\u0627\\u0637\\u0641 \\u0627\\u0644\\u0645\\u062a\\u0646\\u0648\\u0639\\u0629.\",\"en\":\"Contemporary, reinterpretation of a very floriental fragrance.\\nBukhoor Al Ajwad is a  contemperary, reinterpretation of a very floriental fragrance. The opening zesty bergamot, with lusciously tarty spice inflected blueberry conjures happy memories. The scent of a thousand roses aloft sweetened wafting jasmine opens into a  rich creamy, lingering oriental base of precious oudh, cashmere musk and sandalwood, lent a powerful ambry-leathery depth by labdanum.  Ajwad is complex and sophisticated experience of varying and brilliant deluges akin to a journey through varied emotions.\"}', 25, 0, 20, NULL, 125, NULL, 1, 3, NULL, 883, '2022-01-30 04:36:46', '2022-02-14 07:30:14'),
