(2, NULL, 'questions', '[{\"title_ar\":\"\\u0645\\u0627\\u0630\\u0627 \\u062a\\u0628\\u064a\\u0639\\u0648\\u0646 \\u0641\\u064a \\u0645\\u062a\\u062c\\u0631 \\u0631\\u0643\\u0646 \\u0627\\u0644\\u0641\\u062e\\u0627\\u0645\\u0629\\u061f\",\"title_en\":\"What do you sell in the rukn alfakhamah store?\",\"answer_ar\":\"\\u0647\\u0648 \\u0645\\u062a\\u062c\\u0631 \\u0627\\u0644\\u0627\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0629 \\u064a\\u0624\\u0645\\u0646 \\u0628\\u0627\\u0642\\u0629 \\u0645\\u062a\\u0646\\u0648\\u0639\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u062e\\u064a\\u0627\\u0631\\u0627\\u062a \\u0644\\u0644\\u0645\\u0634\\u062a\\u0631\\u064a\\u0646\\u060c \\u062a\\u0645\\u0643\\u0651\\u0646\\u0647\\u0645 \\u0645\\u0646 \\u0639\\u0642\\u062f \\u0635\\u0641\\u0642\\u0627\\u062a \\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0639\\u0628\\u0631 \\u0628\\u064a\\u0626\\u0629 \\u0627\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0629 \\u0622\\u0645\\u0646\\u0629 \\u0644\\u0644\\u0634\\u0631\\u0627\\u0621 \\u0648\\u0627\\u0644\\u0627\\u062e\\u062a\\u064a\\u0627\\u0631 \\u0645\\u0646 \\u0645\\u062c\\u0645\\u0648\\u0639\\u0629 \\u0643\\u0628\\u064a\\u0631\\u0629 \\u0645\\u0646 \\u0627\\u0644\\u0639\\u0637\\u0648\\u0631\\u060c \\u0627\\u0644\\u0639\\u0648\\u062f\\u060c \\u0627\\u0644\\u0628\\u062e\\u0648\\u0631\\u060c \\u0627\\u0644\\u0639\\u0646\\u0628\\u0631\\u060c \\u0627\\u0644\\u0645\\u0633\\u0643\\u060c \\u0627\\u0644\\u0648\\u0631\\u062f \\u0627\\u0644\\u0637\\u0627\\u0626\\u0641\\u064a\\u060c \\u0645\\u0639\\u0637\\u0631\\u0627\\u062a \\u0627\\u0644\\u0641\\u0631\\u0627\\u0634 \\u0648\\u0627\\u0644\\u063a\\u0631\\u0641\\u060c \\u0645\\u0646\\u062a\\u062c\\u0627\\u062a \\u0627\\u0644\\u0639\\u0646\\u0627\\u064a\\u0629 \\u0627\\u0644\\u0634\\u062e\\u0635\\u064a\\u0629 \\u0648\\u0645\\u0644\\u0627\\u0628\\u0633 \\u0631\\u062c\\u0627\\u0644\\u064a\\u0629 \\u0648\\u0646\\u0633\\u0627\\u0626\\u064a\\u0629 \\u0648\\u0623\\u062b\\u0648\\u0627\\u0628 \\u0648\\u062c\\u0646\\u0627\\u0628\\u064a \\u0648\\u0642\\u0633\\u0645 \\u062e\\u0627\\u0635 \\u0628\\u0627\\u0644\\u0623\\u0637\\u0641\\u0627\\u0644 \\u0648\\u0627\\u0644\\u062e\\u0648\\u0627\\u062a\\u0645 \\u0648\\u0627\\u0644\\u0635\\u0646\\u0627\\u062f\\u0644 \\u0648\\u063a\\u064a\\u0631\\u0647\\u0627.\",\"answer_en\":\"It is an electronic store that provides a variety of options for buyers, enabling them to conclude commercial deals through a secure electronic environment to buy and choose from a wide range of perfumes, oud, incense, amber, musk, Taif roses, bed and room fresheners, personal care products, men\'s and women\'s clothing, dresses and Janabi And a special section for children, rings, sandals and others.\"},{\"title_ar\":\"\\u0643\\u064a\\u0641 \\u064a\\u0645\\u0643\\u0646\\u0646\\u064a \\u0627\\u0644\\u0634\\u0631\\u0627\\u0621 \\u0639\\u0628\\u0631 \\u0647\\u0630\\u0627 \\u0627\\u0644\\u0645\\u0648\\u0642\\u0639 \\u0627\\u0644\\u0627\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u061f\",\"title_en\":\"How can I purchase through this website?\",\"answer_ar\":\"\\u0630\\u0644\\u0643 \\u0628\\u0645\\u0646\\u062a\\u0647\\u0649 \\u0627\\u0644\\u0633\\u0647\\u0648\\u0644\\u0629\\u060c \\u062d\\u064a\\u062b \\u064a\\u0645\\u0643\\u0646\\u0643 \\u0628\\u0628\\u0633\\u0627\\u0637\\u0629 \\u0632\\u064a\\u0627\\u0631\\u0629 \\u0627\\u0644\\u0645\\u0648\\u0642\\u0639 \\u0648\\u062a\\u0635\\u0641\\u0651\\u062d\\u0647 \\u062b\\u0645 \\u0627\\u062e\\u062a\\u064a\\u0627\\u0631 \\u0645\\u0627 \\u062a\\u0634\\u0627\\u0621 \\u0645\\u0646 \\u0627\\u0644\\u0645\\u0646\\u062a\\u062c\\u0627\\u062a \\u0627\\u0644\\u0645\\u0639\\u0631\\u0648\\u0636\\u0629 \\u0643\\u0645\\u0627 \\u0648\\u0627\\u062e\\u062a\\u064a\\u0627\\u0631 \\u0648\\u0633\\u064a\\u0644\\u0629 \\u0627\\u0644\\u062f\\u0641\\u0639 \\u0627\\u0644\\u062a\\u064a \\u062a\\u0646\\u0627\\u0633\\u0628 \\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a\\u0643. \\u0648\\u0628\\u0639\\u062f \\u0634\\u0631\\u0627\\u0621 \\u0627\\u0644\\u0645\\u0646\\u062a\\u062c\\u060c \\u0633\\u064a\\u062a\\u0645 \\u062a\\u0648\\u0635\\u064a\\u0644\\u0647 \\u0627\\u0644\\u0649 \\u0639\\u0646\\u0648\\u0627\\u0646\\u0643 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0634\\u0631\\u0643\\u0627\\u0626\\u0646\\u0627 \\u0641\\u064a \\u062e\\u062f\\u0645\\u0627\\u062a \\u0627\\u0644\\u062a\\u0648\\u0635\\u064a\\u0644.\",\"answer_en\":\"This is very easy, as you can simply visit the site and browse it, then choose what you want from the offered products and choose the payment method that suits your needs. After purchasing the product, it will be delivered to your address through our delivery partners.\"},{\"title_ar\":\"\\u0644\\u0642\\u062f \\u0642\\u0645\\u062a \\u0628\\u0634\\u0631\\u0627\\u0621 \\u0645\\u0646\\u062a\\u062c \\u0648\\u062a\\u0644\\u0642\\u0651\\u064a\\u062a \\u0628\\u0631\\u064a\\u062f\\u064b\\u0627 \\u0627\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0651\\u064b\\u0627 \\u064a\\u0624\\u0643\\u0651\\u062f \\u0630\\u0644\\u0643\\u060c \\u0641\\u0645\\u0627\\u0630\\u0627 \\u064a\\u0646\\u0628\\u063a\\u064a \\u0639\\u0644\\u064a\\u0651 \\u0641\\u0639\\u0644\\u0647 \\u062d\\u064a\\u0627\\u0644 \\u0630\\u0644\\u0643\\u061f\",\"answer_ar\":\"\\u062a\\u0647\\u0627\\u0646\\u064a\\u0646\\u0627 \\u0644\\u0634\\u0631\\u0627\\u0626\\u0643 \\u0639\\u0628\\u0631 \\u0645\\u062a\\u062c\\u0631\\u0646\\u0627! \\u0644\\u064a\\u0633 \\u0639\\u0644\\u064a\\u0643 \\u0627\\u0644\\u0631\\u062f \\u0645\\u0627 \\u0644\\u0645 \\u064a\\u062a\\u0645 \\u0627\\u0644\\u0627\\u062a\\u0635\\u0627\\u0644 \\u0628\\u0643 \\u0645\\u0646 \\u0642\\u0628\\u0644 \\u0641\\u0631\\u064a\\u0642 \\u062e\\u062f\\u0645\\u0629 \\u0627\\u0644\\u0639\\u0645\\u0644\\u0627\\u0621 \\u0623\\u0648 \\u064a\\u0637\\u0644\\u0628 \\u0630\\u0644\\u0643 \\u0645\\u0646\\u0643 \\u062a\\u062d\\u062f\\u064a\\u062f\\u064b\\u0627\\u060c \\u0641\\u0647\\u0630\\u0627 \\u064a\\u062d\\u062f\\u062b \\u0641\\u0642\\u0637 \\u0645\\u0646 \\u0623\\u062c\\u0644 \\u062a\\u0623\\u0643\\u064a\\u062f \\u0637\\u0644\\u0628\\u0643 \\u0648\\u0636\\u0645\\u0627\\u0646 \\u0642\\u062f\\u0631\\u062a\\u0643 \\u0639\\u0644\\u0649 \\u062a\\u062a\\u0628\\u0639\\u0647.\",\"title_en\":\"I purchased a product and received an email confirming it, what should I do about it?\",\"answer_en\":\"Congratulations on your purchase via our store! You do not have to respond unless you have been contacted by our customer service team or specifically requested to do so, this is only to confirm your order and ensure that you are able to track it.\"},{\"title_ar\":\"\\u0645\\u0627\\u0630\\u0627 \\u0639\\u0646 \\u0637\\u0631\\u0642 \\u0627\\u0644\\u062f\\u0641\\u0639 \\u0627\\u0644\\u0645\\u062a\\u0648\\u0641\\u0631\\u0629 \\u0644\\u062f\\u0649  ruknalfakhamah.fashion\\u061f\",\"title_en\":\"What about the payment methods available at ruknalfakhamah.fashion?\",\"answer_ar\":\"\\u0639\\u0628\\u0631 \\u0627\\u0644\\u062f\\u0641\\u0639 \\u0627\\u0644\\u0627\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u060c \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0641\\u064a\\u0632\\u0627 \\u0623\\u0648 \\u0645\\u0627\\u0633\\u062a\\u0631\\u0643\\u0627\\u0631\\u062f.\",\"answer_en\":\"Via electronic payment, through Visa or MasterCard.\"},{\"title_ar\":\"\\u0645\\u062a\\u0649 \\u0623\\u0633\\u062a\\u0644\\u0645 \\u0637\\u0644\\u0628\\u064a\\u061f\",\"title_en\":\"When do I receive my order?\",\"answer_ar\":\"\\u0628\\u0639\\u062f \\u062a\\u0623\\u0643\\u064a\\u062f \\u0639\\u0645\\u0644\\u064a\\u0629 \\u0627\\u0644\\u0634\\u0631\\u0627\\u0621\\u060c \\u0633\\u064a\\u062a\\u0645 \\u0627\\u064a\\u0635\\u0627\\u0644 \\u0637\\u0644\\u0628\\u0643 \\u0645\\u0628\\u0627\\u0634\\u0631\\u0629 \\u0627\\u0644\\u0649 \\u0639\\u0646\\u0648\\u0627\\u0646\\u0643 \\u0628\\u063a\\u0636\\u0648\\u0646 \\u062e\\u0645\\u0633\\u0629 \\u0623\\u064a\\u0627\\u0645 \\u0639\\u0645\\u0644 \\u0643\\u062d\\u062f \\u0623\\u0642\\u0635\\u0649. \\u0625\\u0646 \\u0623\\u062d\\u062f \\u0645\\u0646\\u062f\\u0648\\u0628\\u064a \\u0634\\u0631\\u0643\\u0629 \\u0627\\u0644\\u062a\\u0648\\u0635\\u064a\\u0644 \\u0633\\u064a\\u0642\\u0648\\u0645 \\u0628\\u0627\\u0644\\u0627\\u062a\\u0635\\u0627\\u0644 \\u0628\\u0643 \\u0644\\u0644\\u0627\\u062a\\u0641\\u0627\\u0642 \\u0639\\u0644\\u0649 \\u0645\\u0648\\u0639\\u062f \\u062a\\u0633\\u0644\\u064a\\u0645 \\u0627\\u0644\\u0637\\u0644\\u0628\\u060c \\u0641\\u0627\\u0644\\u0631\\u062c\\u0627\\u0621 \\u0627\\u0644\\u0631\\u062f \\u0639\\u0644\\u0649 \\u0647\\u0630\\u0647 \\u0627\\u0644\\u0627\\u062a\\u0635\\u0627\\u0644\\u0627\\u062a \\u0648\\u0627\\u0644\\u062a\\u0648\\u0627\\u062c\\u062f \\u0641\\u064a \\u0627\\u0644\\u0645\\u0643\\u0627\\u0646 \\u0648\\u0627\\u0644\\u0632\\u0645\\u0627\\u0646 \\u0627\\u0644\\u0645\\u062a\\u0641\\u0642 \\u0639\\u0644\\u064a\\u0647\\u0645\\u0627 \\u0633\\u0627\\u0628\\u0642\\u064b\\u0627 \\u0644\\u062a\\u062c\\u0646\\u0651\\u0628 \\u0623\\u064a \\u062a\\u0623\\u062e\\u064a\\u0631 \\u0641\\u064a \\u062a\\u0648\\u0635\\u064a\\u0644 \\u0627\\u0644\\u0637\\u0644\\u0628.\",\"answer_en\":\"After your purchase is confirmed, your order will be delivered directly to your address within a maximum of five working days. A representative of the delivery company will contact you to agree on the date of delivery of the order. Please respond to these calls and be present at the previously agreed place and time to avoid any delay in the delivery of the order.\"},{\"title_ar\":\"\\u0644\\u0645 \\u064a\\u0635\\u0644\\u0646\\u064a \\u0637\\u0644\\u0628\\u064a \\u0628\\u0639\\u062f\\u060c \\u0644\\u0645\\u0627\\u0630\\u0627\\u061f\",\"title_en\":\"I haven\'t received my order yet, why?\",\"answer_ar\":\"\\u0627\\u0644\\u062a\\u0623\\u062e\\u064a\\u0631 \\u0641\\u064a \\u0627\\u0644\\u062a\\u0648\\u0635\\u064a\\u0644 \\u0642\\u062f \\u064a\\u062d\\u0635\\u0644 \\u0644\\u0639\\u062f\\u0651\\u0629 \\u0623\\u0633\\u0628\\u0627\\u0628 \\u0643\\u062a\\u063a\\u064a\\u064a\\u0631 \\u0645\\u0641\\u0627\\u062c\\u0626 \\u0641\\u064a \\u062c\\u062f\\u0648\\u0644 \\u0627\\u0644\\u062a\\u0633\\u0644\\u064a\\u0645 \\u0648\\u062e\\u0627\\u0635\\u0629 \\u062e\\u0644\\u0627\\u0644 \\u0641\\u062a\\u0631\\u0629 \\u0627\\u0644\\u0639\\u0631\\u0648\\u0636 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0648\\u0627\\u0644\\u062a\\u0646\\u0632\\u064a\\u0644\\u0627\\u062a \\u0648\\u0627\\u0644\\u0639\\u0637\\u0644 \\u0627\\u0644\\u0631\\u0633\\u0645\\u064a\\u0651\\u0629. \\u0643\\u0645\\u0627 \\u0648\\u064a\\u0645\\u0643\\u0646 \\u0623\\u0646 \\u064a\\u0643\\u0648\\u0646 \\u0647\\u0630\\u0627 \\u0627\\u0644\\u062a\\u0623\\u062e\\u064a\\u0631 \\u0646\\u0627\\u062a\\u062c \\u0639\\u0646 \\u0627\\u0644\\u0645\\u0634\\u062a\\u0631\\u064a \\u0643\\u0639\\u062f\\u0645 \\u0627\\u0644\\u0631\\u062f\\u0651 \\u0639\\u0644\\u0649 \\u0627\\u062a\\u0635\\u0627\\u0644\\u0627\\u062a\\u0646\\u0627 \\u0623\\u0648 \\u062d\\u062a\\u0649 \\u0639\\u062f\\u0645 \\u0627\\u0644\\u062a\\u0648\\u0627\\u062c\\u062f \\u0641\\u064a \\u0627\\u0644\\u0645\\u0648\\u0642\\u0639 \\u0648\\u0627\\u0644\\u0632\\u0645\\u0627\\u0646 \\u0627\\u0644\\u0645\\u062d\\u062f\\u062f\\u064a\\u0646 \\u0644\\u0644\\u062a\\u0633\\u0644\\u064a\\u0645. \\u0648\\u0644\\u0645\\u062a\\u0627\\u0628\\u0639\\u0629 \\u0645\\u0631\\u0627\\u062d\\u0644 \\u0634\\u062d\\u0646 \\u0627\\u0644\\u0633\\u0644\\u0639\\u0629\\u060c \\u0627\\u0644\\u0631\\u062c\\u0627\\u0621 \\u0627\\u0644\\u062a\\u062d\\u0642\\u0642 \\u0645\\u0646 \\\"\\u0628\\u0648\\u0644\\u064a\\u0635\\u0629 \\u0627\\u0644\\u0634\\u062d\\u0646\\\" \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0643 \\u0648\\u0630\\u0644\\u0643 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0627\\u0644\\u062f\\u062e\\u0648\\u0644 \\u0627\\u0644\\u0649 \\u0645\\u0648\\u0642\\u0639\\u0646\\u0627 \\u0627\\u0644\\u0627\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a. \\u0644\\u0645\\u0632\\u064a\\u062f \\u0645\\u0646 \\u0627\\u0644\\u0627\\u0633\\u062a\\u0641\\u0633\\u0627\\u0631\\u0627\\u062a\\u060c \\u0627\\u062a\\u0635\\u0644 \\u0628\\u0646\\u0627 \\u0641\\u0646\\u062d\\u0646 \\u0645\\u0648\\u062c\\u0648\\u062f\\u064a\\u0646 \\u062f\\u0627\\u0626\\u0645\\u064b\\u0627 \\u0644\\u062e\\u062f\\u0645\\u062a\\u0643.\",\"answer_en\":\"Delays in delivery may occur for several reasons, such as a sudden change in the delivery schedule, especially during the period of special offers, sales and public holidays. Also, this delay could be caused by the buyer, such as not responding to our communications or even not being in the location and time specified for delivery. To follow the stages of shipment of the item, please check your \\\"Bill of Lading\\\" by entering our website. For more inquiries, contact us, we are always here to serve you.\"},{\"title_ar\":\"\\u0645\\u0627\\u0630\\u0627 \\u0644\\u0648 \\u0636\\u0627\\u0639 \\u0645\\u0646\\u062a\\u062c\\u064a\\u061f\",\"title_en\":\"What if my product is lost?\",\"answer_ar\":\"\\u0644\\u0627 \\u062f\\u0627\\u0639\\u064a \\u0644\\u0644\\u0642\\u0644\\u0642\\u060c \\u0641\\u0644\\u0627 \\u062a\\u0639\\u062a\\u0628\\u0631 \\u0627\\u0644\\u0633\\u0644\\u0639\\u0629 \\u0645\\u0633\\u062a\\u0644\\u0645\\u0629 \\u0627\\u0644\\u0627 \\u0628\\u062d\\u0635\\u0648\\u0644\\u0646\\u0627 \\u0639\\u0644\\u0649 \\u062a\\u0648\\u0642\\u064a\\u0639\\u0643 \\u0639\\u0644\\u0649 \\u0645\\u0630\\u0643\\u0631\\u0629 \\u0627\\u0644\\u0627\\u0633\\u062a\\u0644\\u0627\\u0645. \\u0648\\u0623\\u064a\\u0651\\u064b\\u0627 \\u0643\\u0627\\u0646 \\u0627\\u0644\\u0633\\u0628\\u0628 \\u0648\\u0631\\u0627\\u0621 \\u0630\\u0644\\u0643\\u060c \\u0641\\u0633\\u062a\\u062a\\u0644\\u0642\\u0649 \\u0643\\u0627\\u0645\\u0644 \\u0627\\u0644\\u0645\\u0628\\u0644\\u063a \\u0627\\u0644\\u0645\\u062f\\u0641\\u0648\\u0639 \\u0623\\u0648 \\u0628\\u062f\\u064a\\u0644\\u0627\\u064b \\u0639\\u0646 \\u0627\\u0644\\u0645\\u0646\\u062a\\u062c \\u0627\\u0644\\u0645\\u0641\\u0642\\u0648\\u062f.\",\"answer_en\":\"No need to worry, the item is not considered received unless we get your signature on the receipt note. Whatever the reason, you will receive a full refund or a replacement for the lost product.\"},{\"title_ar\":\"\\u0645\\u0627\\u0630\\u0627 \\u0644\\u0648 \\u0627\\u0633\\u062a\\u0644\\u0645\\u062a \\u0645\\u0646\\u062a\\u062c\\u064b\\u0627 \\u0645\\u062e\\u062a\\u0644\\u0641\\u064b\\u0627 \\u0639\\u0645\\u0627 \\u0627\\u0634\\u062a\\u0631\\u064a\\u062a\\u061f\",\"title_en\":\"What if I receive a different product than I purchased?\",\"answer_ar\":\"\\u0641\\u064a \\u0647\\u0630\\u0647 \\u0627\\u0644\\u062d\\u0627\\u0644\\u0629\\u060c \\u0627\\u062a\\u0635\\u0644 \\u0628\\u0646\\u0627 \\u0645\\u0628\\u0627\\u0634\\u0631\\u0629\\u064b \\u0648\\u0633\\u064a\\u062a\\u0645 \\u0627\\u0633\\u062a\\u0628\\u062f\\u0627\\u0644 \\u0627\\u0644\\u0645\\u0646\\u062a\\u062c \\u0641\\u0648\\u0631\\u064b\\u0627.\",\"answer_en\":\"In this case, contact us directly and the product will be replaced immediately.\"},{\"title_ar\":\"\\u0625\\u0630\\u0627 \\u0639\\u062f\\u0644\\u062a \\u0639\\u0646 \\u0631\\u0623\\u064a\\u060c \\u0641\\u0647\\u0644 \\u064a\\u0645\\u0643\\u0646\\u0646\\u064a \\u0625\\u0639\\u0627\\u062f\\u0629 \\u0627\\u0644\\u0633\\u0644\\u0639\\u0629 \\u0627\\u0644\\u062a\\u064a \\u0627\\u0634\\u062a\\u0631\\u064a\\u062a\\u0647\\u0627\\u061f\",\"title_en\":\"If I change my mind, can I return the item I purchased?\",\"answer_ar\":\"\\u0628\\u0643\\u0644 \\u062a\\u0623\\u0643\\u064a\\u062f\\u060c \\u0641\\u0646\\u062d\\u0646 \\u0646\\u062a\\u0641\\u0647\\u0645 \\u0623\\u0646\\u0647 \\u0648\\u0641\\u064a \\u0628\\u0639\\u0636 \\u0627\\u0644\\u0627\\u062d\\u064a\\u0627\\u0646\\u060c \\u062a\\u0639\\u062f\\u0644 \\u0639\\u0646 \\u0634\\u0631\\u0627\\u0621 \\u0645\\u0646\\u062a\\u062c \\u0645\\u0639\\u064a\\u0651\\u0646\\u060c \\u0641\\u0644\\u0630\\u0644\\u0643\\u060c \\u0648\\u0641\\u064a \\u062d\\u0627\\u0644 \\u0644\\u0645 \\u062a\\u0633\\u062a\\u0644\\u0645 \\u0645\\u0627 \\u0637\\u0644\\u0628\\u062a\\u0647 \\u0628\\u0639\\u062f\\u060c \\u064a\\u0645\\u0643\\u0646\\u0643 \\u0627\\u0644\\u063a\\u0627\\u0626\\u0647 \\u0648\\u0633\\u062a\\u0633\\u062a\\u0631\\u062c\\u0639 \\u0645\\u0627 \\u062f\\u0641\\u0639\\u062a\\u0647 \\u0641\\u064a \\u062d\\u0627\\u0644 \\u0627\\u0633\\u062a\\u0639\\u0645\\u0644\\u062a \\u0637\\u0631\\u0642 \\u0627\\u0644\\u062f\\u0641\\u0639 \\u0627\\u0644\\u0627\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0629 \\u0648\\u0644\\u0643\\u0646 \\u0647\\u0630\\u0627 \\u0642\\u062f \\u064a\\u062a\\u0637\\u0644\\u0651\\u0628 \\u0628\\u0639\\u0636 \\u0627\\u0644\\u0648\\u0642\\u062a \\u0644\\u064a\\u0636\\u0627\\u0641 \\u0627\\u0644\\u0649 \\u062d\\u0633\\u0627\\u0628\\u0643 \\u0627\\u0644\\u0645\\u0635\\u0631\\u0641\\u064a. \\u0648\\u0641\\u064a \\u062d\\u0627\\u0644 \\u0623\\u0631\\u062f\\u062a \\u0625\\u0639\\u0627\\u062f\\u0629 \\u0633\\u0644\\u0639\\u0629 \\u0642\\u062f \\u0648\\u0635\\u0644\\u062a\\u0643 \\u0623\\u0635\\u0644\\u0627\\u064b\\u060c \\u0628\\u0627\\u0644\\u0625\\u0645\\u0643\\u0627\\u0646 \\u0641\\u0639\\u0644 \\u0630\\u0644\\u0643 \\u062e\\u0644\\u0627\\u0644 \\u0645\\u0647\\u0644\\u0629 15 \\u064a\\u0648\\u0645\\u0627\\u064b \\u0645\\u0646 \\u062a\\u0627\\u0631\\u064a\\u062e \\u0648\\u0636\\u0639 \\u0627\\u0644\\u0637\\u0644\\u0628 \\u0639\\u0644\\u0649 \\u0634\\u0631\\u0637 \\u0627\\u0644\\u0645\\u062d\\u0627\\u0641\\u0638\\u0629 \\u0639\\u0644\\u0649 \\u063a\\u0644\\u0627\\u0641\\u0647\\u0627 \\u0627\\u0644\\u0627\\u0635\\u0644\\u064a \\u0648\\u062d\\u0627\\u0644\\u062a\\u0647\\u0627 \\u0643\\u0645\\u0627 \\u0627\\u0633\\u062a\\u0644\\u0645\\u062a\\u0647\\u0627. \\u0641\\u064a \\u062c\\u0645\\u064a\\u0639 \\u0627\\u0644\\u0627\\u062d\\u0648\\u0627\\u0644\\u060c \\u0627\\u062a\\u0635\\u0644 \\u0628\\u0646\\u0627 \\u0644\\u0625\\u0639\\u0627\\u062f\\u0629 \\u0627\\u0644\\u0633\\u0644\\u0639\\u0629 \\u0623\\u0648 \\u0627\\u0633\\u062a\\u0631\\u062f\\u0627\\u062f \\u0627\\u0644\\u0645\\u0628\\u0627\\u0644\\u063a \\u0627\\u0644\\u0645\\u0627\\u0644\\u064a\\u0629 \\u0627\\u0644\\u0645\\u062f\\u0641\\u0648\\u0639\\u0629.\",\"answer_en\":\"Certainly, we understand that sometimes, you cancel the purchase of a specific product, so if you have not received what you ordered yet, you can cancel it and get back what you paid if you used electronic payment methods, but this may require some time to be added to your bank account. In the event that you want to return an item that you have already received, you can do so within 15 days from the date of placing the order, provided that the original packaging and condition as you received it are preserved. In any case, contact us to return the item or get a refund.\"},{\"title_ar\":\"\\u0647\\u0644 \\u0633\\u064a\\u062a\\u0645 \\u0627\\u0639\\u0627\\u062f\\u0629 \\u0643\\u0627\\u0645\\u0644 \\u0627\\u0644\\u0645\\u0628\\u0644\\u063a \\u0627\\u0644\\u0645\\u062f\\u0641\\u0648\\u0639 \\u0644\\u0644\\u0633\\u0644\\u0639\\u0629 \\u0627\\u0644\\u062a\\u064a \\u0623\\u0639\\u062f\\u062a\\u061f\",\"title_en\":\"Will the full amount paid for the item that was prepared be refunded?\",\"answer_ar\":\"\\u0633\\u0648\\u0641 \\u064a\\u062a\\u0645 \\u062e\\u0635\\u0645 \\u0642\\u064a\\u0645\\u0629 \\u0631\\u0633\\u0648\\u0645 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0648\\/\\u0623\\u0648 \\u0627\\u0644\\u0628\\u0646\\u0643\\u060c \\u0641\\u064a \\u062d\\u0627\\u0644 \\u0627\\u0644\\u062f\\u0641\\u0639 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0627\\u0644\\u0628\\u0637\\u0627\\u0642\\u0629 \\u0627\\u0644\\u0645\\u0635\\u0631\\u0641\\u064a\\u0629. \\u0648\\u0641\\u064a \\u062d\\u0627\\u0644 \\u0643\\u0627\\u0646\\u062a \\u0627\\u0644\\u0633\\u0644\\u0639\\u0629 \\u0645\\u063a\\u0627\\u064a\\u0631\\u0629 \\u0644\\u0645\\u0627 \\u062a\\u0645 \\u0627\\u0644\\u0627\\u0639\\u0644\\u0627\\u0646 \\u0639\\u0646\\u0647 \\u0639\\u0644\\u0649 \\u0635\\u0639\\u064a\\u062f \\u0627\\u0644\\u0645\\u0648\\u0627\\u0635\\u0641\\u0627\\u062a \\u0648\\u0627\\u0644\\u0627\\u062f\\u0627\\u0621 \\u0623\\u0648 \\u064a\\u0634\\u0648\\u0628\\u0647\\u0627 \\u0623\\u064a \\u062e\\u0644\\u0644\\u060c \\u0639\\u0646\\u062f\\u0647\\u0627 \\u064a\\u062a\\u0645 \\u0627\\u0639\\u0641\\u0627\\u0626\\u0643 \\u0645\\u0646 \\u0633\\u062f\\u0627\\u062f \\u0642\\u064a\\u0645\\u0629 \\u0627\\u0644\\u0631\\u0633\\u0648\\u0645.\",\"answer_en\":\"Shipping and\\/or bank charges will be deducted, if you pay with a bank card. In the event that the commodity is different from what has been announced in terms of specifications and performance, or is tainted by any defect, then you will be exempted from paying the value of the fees.\"},{\"title_ar\":\"\\u0647\\u0644 \\u064a\\u0645\\u0643\\u0646\\u0646\\u064a \\u062a\\u0628\\u062f\\u064a\\u0644 \\u0627\\u0644\\u0633\\u0644\\u0639\\u0629 \\u0627\\u0644\\u062a\\u064a \\u0627\\u0634\\u062a\\u0631\\u064a\\u062a\\u0647\\u0627\\u061f\",\"title_en\":\"Can I exchange the item I purchased?\",\"answer_ar\":\"\\u0628\\u0643\\u0644 \\u062a\\u0623\\u0643\\u064a\\u062f\\u060c \\u0644\\u0643\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0645\\u0647\\u0644\\u0629 15 \\u064a\\u0648\\u0645\\u0627\\u064b \\u0645\\u0646 \\u062a\\u0627\\u0631\\u064a\\u062e \\u0627\\u0644\\u0634\\u0631\\u0627\\u0621 \\u0648\\u064a\\u0646\\u0628\\u063a\\u064a \\u0644\\u0630\\u0644\\u0643 \\u0645\\u0631\\u0627\\u062c\\u0639\\u062a\\u0646\\u0627 \\u0648\\u062a\\u0639\\u0628\\u0626\\u0629 \\u0642\\u0633\\u064a\\u0645\\u0629 \\u0627\\u0644\\u0627\\u0633\\u062a\\u0628\\u062f\\u0627\\u0644 \\u0644\\u064a\\u062a\\u0645 \\u0627\\u0644\\u0645\\u0648\\u0627\\u0641\\u0642\\u0629 \\u0639\\u0644\\u0649 \\u0639\\u0645\\u0644\\u064a\\u0629 \\u0627\\u0644\\u0628\\u062f\\u0644.\",\"answer_en\":\"Of course, but within 15 days from the date of purchase, we must review and fill out the replacement voucher to be approved for the replacement process.\"},{\"title_ar\":\"\\u0645\\u0627\\u0630\\u0627 \\u0623\\u0641\\u0639\\u0644 \\u0641\\u064a \\u062d\\u0627\\u0644 \\u0648\\u062c\\u0648\\u062f \\u0623\\u064a \\u062e\\u0644\\u0644 \\u0641\\u064a \\u0627\\u0644\\u0645\\u0646\\u062a\\u062c \\u0627\\u0644\\u0630\\u064a \\u0627\\u0634\\u062a\\u0631\\u064a\\u062a\\u061f\",\"title_en\":\"What should I do if there is any defect in the product I purchased?\",\"answer_ar\":\"\\u0625\\u0646 \\u062c\\u0645\\u064a\\u0639 \\u0627\\u0644\\u0628\\u0636\\u0627\\u0626\\u0639 \\u0627\\u0644\\u0645\\u0639\\u0631\\u0648\\u0636\\u0629 \\u0642\\u062f \\u062e\\u0636\\u0639\\u062a \\u0644\\u0639\\u0645\\u0644\\u064a\\u0627\\u062a \\u0636\\u0628\\u0637 \\u0627\\u0644\\u062c\\u0648\\u062f\\u0629 \\u0628\\u062d\\u064a\\u062b \\u0623\\u0646\\u0647 \\u064a\\u0633\\u062a\\u0628\\u0639\\u062f \\u0648\\u062c\\u0648\\u062f \\u0623\\u064a \\u062e\\u0644\\u0644 \\u0628\\u0647\\u0627\\u060c \\u0648\\u0644\\u0643\\u0646 \\u0641\\u064a \\u062d\\u0627\\u0644 \\u0644\\u0627\\u062d\\u0638\\u062a \\u0627\\u0644\\u0639\\u0643\\u0633\\u060c \\u0627\\u062a\\u0635\\u0644 \\u0628\\u0646\\u0627  \\u0644\\u062e\\u062f\\u0645\\u062a\\u0643.\",\"answer_en\":\"All the offered merchandise has undergone quality control processes to rule out any defect, but if you notice the opposite, contact us to serve you.\"},{\"title_ar\":\"\\u0644\\u0642\\u062f \\u062a\\u0642\\u062f\\u0645\\u062a \\u0628\\u0634\\u0643\\u0648\\u0649 \\u0648\\u0644\\u0643\\u0646 \\u0644\\u0645 \\u064a\\u062d\\u0635\\u0644 \\u0634\\u064a\\u0621 \\u0628\\u0639\\u062f\\u0647\\u0627\\u060c \\u0644\\u0645\\u0627\\u0630\\u0627\\u061f\",\"title_en\":\"I filed a complaint but nothing happened after that, why?\",\"answer_ar\":\"\\u0646\\u0639\\u062a\\u0630\\u0631 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u062a\\u0623\\u062e\\u064a\\u0631 \\u0627\\u0644\\u062d\\u0627\\u0635\\u0644 \\u0648\\u0644\\u0643\\u0646 \\u0644\\u0627 \\u062f\\u0627\\u0639\\u064a \\u0644\\u0644\\u0642\\u0644\\u0642 \\u0641\\u0625\\u0646 \\u0643\\u0644 \\u0634\\u0643\\u0648\\u0649 \\u062a\\u0633\\u062c\\u0651\\u0644 \\u0644\\u062f\\u064a\\u0646\\u0627 \\u062a\\u0628\\u0642\\u0649 \\u0639\\u0627\\u0644\\u0642\\u0629 \\u0644\\u062d\\u064a\\u0646 \\u0625\\u064a\\u062c\\u0627\\u062f \\u0627\\u0644\\u062d\\u0644\\u0648\\u0644 \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628\\u0629 \\u0644\\u0647\\u0627\\u060c \\u0641\\u062d\\u062a\\u0645\\u064b\\u0627 \\u0633\\u064a\\u062a\\u0645 \\u0627\\u0644\\u0627\\u062a\\u0635\\u0627\\u0644 \\u0628\\u0643 \\u0642\\u0631\\u064a\\u0628\\u064b\\u0627.\",\"answer_en\":\"We apologize for the delay, but there is no need to worry, as every complaint registered with us remains pending until appropriate solutions are found, so you will definitely be contacted soon.\"},{\"title_ar\":\"\\u0647\\u0644 \\u064a\\u0645\\u0643\\u0646\\u0646\\u064a \\u062a\\u0639\\u062f\\u064a\\u0644 \\u062a\\u0641\\u0627\\u0635\\u064a\\u0644 \\u062d\\u0633\\u0627\\u0628\\u064a \\u0648\\/\\u0623\\u0648 \\u062a\\u0639\\u062f\\u064a\\u0644 \\u0627\\u0644\\u0639\\u0646\\u0648\\u0627\\u0646\\u060c \\u0627\\u0644\\u0627\\u0633\\u0645 \\u0648\\u0643\\u0644\\u0645\\u0629 \\u0627\\u0644\\u0645\\u0631\\u0648\\u0631\\u061f\",\"title_en\":\"Can I modify my account details and\\/or change the address, name and password?\",\"answer_ar\":\"\\u0637\\u0628\\u0639\\u064b\\u0627\\u060c \\u0643\\u0644 \\u0645\\u0627 \\u0639\\u0644\\u064a\\u0643 \\u0641\\u0639\\u0644\\u0647 \\u0647\\u0648 \\u062a\\u0633\\u062c\\u064a\\u0644 \\u0627\\u0644\\u062f\\u062e\\u0648\\u0644 \\u0627\\u0644\\u0649 \\u062d\\u0633\\u0627\\u0628\\u0643 \\u0648\\u0627\\u0644\\u0636\\u063a\\u0637 \\u0639\\u0644\\u0649 \\u0635\\u0648\\u0631\\u0629 \\u062d\\u0633\\u0627\\u0628\\u0643 \\u0641\\u064a \\u0627\\u0644\\u0623\\u0639\\u0644\\u0649 \\u0648\\u0627\\u062c\\u0631\\u0627\\u0621 \\u0627\\u0644\\u062a\\u0639\\u062f\\u064a\\u0644\\u0627\\u062a \\u0627\\u0644\\u062a\\u064a \\u062a\\u0631\\u063a\\u0628 \\u0628\\u0647\\u0627.\",\"answer_en\":\"Of course, all you have to do is log into your account and click on your account picture at the top and make the modifications you want.\"},{\"title_ar\":\"\\u0644\\u0642\\u062f \\u0646\\u063