 on ruknalfakhamah.fashion?\",\"answer_ar\":\"\\u0637\\u0628\\u0639\\u064b\\u0627\\u060c \\u0641\\u0646\\u062d\\u0646 \\u0645\\u0648\\u062c\\u0648\\u062f\\u064a\\u0646 \\u062f\\u0627\\u0626\\u0645\\u064b\\u0627 \\u0644\\u062e\\u062f\\u0645\\u062a\\u0643\\u0645 \\u0628\\u0634\\u0643\\u0644 \\u0623\\u0641\\u0636\\u0644\\u060c \\u0631\\u062c\\u0627\\u0621\\u064b\\u0627 \\u0627\\u062a\\u0635\\u0644 \\u0628\\u0646\\u0627\",\"answer_en\":\"Of course, we are always here to serve you better, please contact us\"}]', NULL, '2022-01-23 00:26:22', '2022-01-23 03:32:26'),
