(1, NULL, 'who_us', '[{\"content_en\":\"Rukn alFakhamah store\\nspecialized in it\\n\\u2022 All Arabic perfumes (Arabian Oud, Abdul Samad Al Qurashi, Al Rasasi, Elite Oud)\\n\\u2022 All kinds of oud and all kinds of musk\\n\\u2022 Yemeni bridal incense - original Arabic incense - royal Indian incense\\n\\u2022 Air freshener and mattress freshener without eyeliner\\n\\u2022 Silver and gold incense burners and complete sets and crystal sets\\n\\u2022 Abayas and embroidered panels of all colors and sizes, and veils of all colors\\n\\u2022 Wonderful embroidered Gulf bags\\n\\u2022 Yemeni udders, detailed and without detail\\n\\u2022 Al-Asil winter and summer dresses of all colors and sizes, and dresses for the ignorant\\n\\u2022 Men\'s padded and unlined pajamas, underwear and underpants of all sizes\\n\\u2022 I don\'t have Hadrami and I\'m white, all colors\\n\\u2022 Yemeni shawls of different types. We also have first-class Kashmiri shawls\\nGulf sandals of all colors and sizes\\n\\u2022 Original Yemeni agate rings, Turkish rings for men and women\'s silver rings\\n\\u2022 swam amber and swam electric\\n\\u2022 Yemeni breast honey, the original royal, let me and my mountain, and wonderful wax honey\\n\\u2022 Yemeni velvet, Yemeni butter and sparrow milk\\n\\u2022 Yemeni bridal henna and henna drawings\",\"content_ar\":\"\\u0645\\u062a\\u062c\\u0631 \\u0631\\u0643\\u0646 \\u0627\\u0644\\u0641\\u062e\\u0627\\u0645\\u0629\\n\\u0645\\u062a\\u062c\\u0631 \\u0645\\u062e\\u062a\\u0635 \\u0641\\u064a\\u0647 \\n\\u2022\\t\\u062c\\u0645\\u064a\\u0639 \\u0627\\u0644\\u0639\\u0637\\u0648\\u0631 \\u0627\\u0644\\u0639\\u0631\\u0628\\u064a\\u0629 (\\u0627\\u0644\\u0639\\u0631\\u0628\\u064a\\u0629 \\u0644\\u0644\\u0639\\u0648\\u062f\\u060c \\u0639\\u0628\\u062f\\u0627\\u0644\\u0635\\u0645\\u062f \\u0627\\u0644\\u0642\\u0631\\u0634\\u064a\\u060c \\u0627\\u0644\\u0631\\u0635\\u0627\\u0635\\u064a\\u060c \\u0646\\u062e\\u0628\\u0629 \\u0627\\u0644\\u0639\\u0648\\u062f) \\n\\u2022\\t\\u06